import Vue from 'vue'
import Router from 'vue-router'
import Login from './views/Login.vue'
import Reg from './views/Reg.vue'
import Login_Reg from './views/Login_Reg.vue'

Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/login',
      name: 'login',
      component: Login
    },
    {
      path: '/reg',
      name: 'reg',
      component: Reg
    },
    {
      path: '/login_reg',
      name: 'login_reg',
      component: Login_Reg
    }
  ]
})
